class Solution:
    def lemonadeChange(bills: list[int]) -> bool:
        change:dict[int:int] = {
            5:0,
            10:0,
            20:0
        }
        for bill in bills:
            print(f"bill:{bill} change:{change}")
            if bill == 5:
                change[bill] += 1
            elif bill == 10 and change[5] > 0:
                change[5] -= 1
                change[bill] += 1
            elif bill == 20 and change[5] > 0 and change[10] > 0:
                change[bill] += 1
                change[5] -= 1
                change[10] -= 1
            elif bill == 20 and change[5] > 2:
                change[bill] += 1
                change[5] -= 3
            else:
                return False

        return True
    
